/**
 * 返回第一个参数。
 *
 * @alias module:Util.identity
 * @since 1.0.0
 * @param {*} value 任意值。
 * @returns 返回 `value`。
 * @example
 *
 * const obj = { a: 1, b: 2 };
 *
 * console.log(identity(obj) === obj); // true
 *
 */
declare function identity<T>(value?: T): T;
declare function identity<T>(value: T, ...args: any[]): T;
export default identity;
